import React from 'react';
import { Box, Flex, Heading, Image, Text, Link, Stack, Button } from '@chakra-ui/core';
import { GoIssueOpened, GoRepoForked } from 'react-icons/go';

export function Repo(props) {

    const { isListView= false, repo } = props;
   // console.log(isListView);

    return (

        <Flex borderWidth={1} bg='white' p='15px' rounded='5px' alignItems='center' >
            <Flex flex={1} flexDir='column'>
                {!isListView && (
                    <Flex mb='15px'>
                        <Image
                            src='data:image/png;base64,'
                            w={'35px'}
                            h={'35px'}
                            rounded='5px'
                        />
                        <Box ml='10px'>
                            <Heading fontSize='16px'>Rupali Kavale</Heading>
                            <Text fontSize='13px'>View profile</Text>
                        </Box>
                    </Flex>
                )}

                <Box mb='15px'>
                    <Box mb='10px'>
                        <Flex fontSize='19px' fontWeight={700} color='purple.700' mb='3px'>
                            {isListView && (
                                <>
                                    <Text as='a'
                                        href='https://github.com/coderquill'
                                        target='_blank' >
                                        coderquill
                            </Text>
                            &nbsp;/&nbsp;
                            </>
                            )}
                            <Text
                                as="a"
                                href="https://github.com/coderquill/githunt"
                                target="_blank"
                            >
                                GitHunt
                        </Text>
                        </Flex>
                        <Text fontSize='14px' color='gray.600'>
                            Built by &middot;{" "}
                            <Link fontWeight={600}
                                href='https://github.com/coderquill/githunt'
                                target='_blank'
                            >Rupali Kavale
                        </Link>{" "}
                        &middot; 17 July, 2020
                        </Text>
                    </Box>
                    <Text fontSize='14px' color='gray.900'>
                        Hunt the most starred projects on any date on github
                    </Text>
                </Box>

                <Stack isInline spacing='10px'>
                    <Button as='a' cursor='pointer' leftIcon='star' variant='link' fontSize='14px' _hover={{ textDecoration: 'none' }} iconSpacing='4px' >9834</Button>
                    <Button as='a' cursor='pointer' leftIcon={GoRepoForked} variant='link' fontSize='14px' _hover={{ textDecoration: 'none' }} iconSpacing='4px' >94</Button>
                    <Button as='a' cursor='pointer' leftIcon={GoIssueOpened} variant='link' fontSize='14px' _hover={{ textDecoration: 'none' }} iconSpacing='4px' >33</Button>
                </Stack>
            </Flex>

            {isListView && (
                <Image
                    src='data:image/png;base64,'
                    w={'185px'}
                    h={'185px'}
                    rounded='100%'
                />
            )}

        </Flex>

    );

}
